export const LoggerMiddleware = next => async (Map, args) => {
  const actionName = Map.getActionName();
  const now = new Date().getTime();
  const name = `Command ${actionName} [${now}]: `;
  console.log(`Pre ${name}`, args);
  const res = await next(Map, args);
  console.log(`Post ${name}`, res);
  return res;
};

export const TimerMiddleware = next => async (Map, args) => {
  const actionName = Map.getActionName();
  const now = new Date().getTime();
  const name = `${actionName}_${now}`;
  console.time(name);
  const res = await next(Map, args);
  console.timeEnd(name);
  return res;
};

import { fromEventPattern } from 'rxjs/internal/observable/fromEventPattern';
import { map } from 'rxjs/internal/operators/map';

const gps = () => {
  const watchPosition = handler => (navigator.geolocation ? navigator.geolocation.watchPosition(handler) : () => { });
  const clearPosition = handler => (navigator.geolocation ? navigator.geolocation.clearWatch(handler) : () => { });

  return fromEventPattern(
    watchPosition,
    clearPosition,
  ).pipe(map(position => position.coords));
};

export default gps;

import { fromEventPattern } from 'rxjs/internal/observable/fromEventPattern';
import { map } from 'rxjs/internal/operators/map';

const center = (context) => {
  const googleMaps = context.library.maps;
  const map_ = context.source.getMap();

  const addClickHandler = handler => map_.addListener('center_changed', handler);
  const removeClickHandler = (handler, listener) => googleMaps.center.removeListener(listener);


  return fromEventPattern(
    addClickHandler,
    removeClickHandler,
  ).pipe(map(() => {
    const _center = map_.getCenter();
    return { lat: _center.lat(), lng: _center.lng() };
  }));
};

