import { from } from 'rxjs/internal/observable/from';
import { switchMap } from 'rxjs/internal/operators/switchMap';
import CommandBus from './CommandBus';

class AsyncCommandBus extends CommandBus {
  constructor() {
    super();
    this.queue = [];
    this.subscribers = [];
    this.allResults = [];
  }

  execute(actionName, action, args) {
    this.queue.push({
      actionName,
      action,
      args,
    });
    if (this.queue.length === 1) {
      this._executingAction = actionName;
      setTimeout(() => this._next(), 1);
    }
  }

  _saveExecution(actionName, result) {
    const res = super._saveExecution(actionName, result);
    this.allResults.push(res.value);
    return res;
  }

  _next() {
    if (this.queue.length === 0) {
      this._complete();
      return;
    }
    const params = this.queue.shift();
    this._execute(params.actionName, params.action, params.args).subscribe((value) => {
      this._next(value);
    });
  }

  _complete() {
    this.subscribers.map(f => f(this._lastAction, this.allResults));
  }

  subscribe(func) {
    this.subscribers.push(func);
  }

  getValue() {
    if (this.isExecuting()) {
      return from(new Promise(resolve => this.subscribe((res) => {
        resolve(res);
      })));
    }
    return super.getValue();
  }

  observer(observerName, ...args) {
    if (this.isExecuting()) {
      return from(new Promise(resolve => this.subscribe(resolve)))
        .pipe(switchMap(() => this._source.observer(observerName, ...args)));
    }
    return this._source.observer(observerName, ...args);
  }
}

AsyncCommandBus.lift = function (source, actionsSubject) {
  const bus = new AsyncCommandBus();
  bus.setSource(source);
  bus.setActionsSubject(actionsSubject);
  return bus;
};

export default AsyncCommandBus;

import { of } from 'rxjs/internal/observable/of';
import { from } from 'rxjs/internal/observable/from';
import { Observable } from 'rxjs/internal/Observable';
import { map } from 'rxjs/internal/operators/map';
import { tap } from 'rxjs/internal/operators/tap';
import isPromise from '../utils/isPromise';

class CommandBus {
  constructor() {
    this._actionsSubject = null;
    this._executingAction = false;
    this._source = null;
    this._lastAction = {
      value: null,
      name: null,
    };
  }

  setSource(source) {
    this._source = source;
  }

  setActionsSubject(actionsSubject) {
    this._actionsSubject = actionsSubject;
  }

  /**
  * @private
  */
  getSource() {
    return this._source;
  }


  /**
   * @private
   */
  getValue() {
    return of(this._lastAction);
  }

  /**
   * Funcion que ejecuta la  funcion sobre
   * @param {*} actionName
   * @param {*} action
   * @param {*} args
   * @private
   */
  execute(actionName, action, args) {
    return this._execute(actionName, action, args).subscribe();
  }

  _saveExecution(actionName, result) {
    this._lastAction = {
      value: result,
      name: actionName,
    };
    this._executingAction = false;
    return this._lastAction;
  }

  _execute(actionName, action, args) {
    this._executingAction = actionName;
    const ret = action(this, args);
    const $let = this._source.observer((isPromise(ret) || ret instanceof Observable) ? from(ret) : of(ret));
    return $let.pipe(
      map(data => this._saveExecution(actionName, data)),
      tap(data => this._actionsSubject.next(data)),
    );
  }

  /**
   *
   * @private
   */
  isExecuting() {
    return !!this._executingAction;
  }

  /**
   * @private
   */
  getActionName() {
    return this._executingAction;
  }

  /**
   *
   * @private
   */
  getContext() {
    return {
      lastExecution: this._lastAction,
      source: this._source,
      ...this._source.getContext(),
    };
  }
}

export default CommandBus;

const _importFunctions = {};

// wait until body is defined before injecting link. This ensures a non-blocking load in IE11.
const ready = (cb) => {
  if (document.body) {
    return cb();
  }
  setTimeout(() => ready(cb));
  return null;
};

const getRef = () => {
  const refs = (document.body || document.getElementsByTagName('head')[0]).childNodes;
  return refs[refs.length - 1];
};

const addElement = (tag) => {
  ready(() => {
    const ref = getRef();
    // Inject link
    // Note: the ternary preserves the existing behavior of 'before' argument, but we could choose to change the argument to 'after'
    // in a later release and standardize on ref.nextSibling for all refs
    // Note: `insertBefore` is used instead of `appendChild`, for safety re: http://www.paulirish.com/2011/surefire-dom-element-insertion/
    if (ref && ref.parentNode) {
      ref.parentNode.insertBefore(tag, ref.nextSibling);
    } else {
      document.head.appendChild(tag);
    }
  });
};

