export const loadCSS = href => new Promise((resolve) => {
  const ss = document.createElement('link');
  ss.rel = 'stylesheet';
  ss.href = href;
  // temporarily set media to something inapplicable to ensure it'll fetch without blocking render
  ss.media = 'only x';
  addElement(ss);
  // A method (exposed on return object for external use) that mimics onload by polling document.styleSheets until it includes the new sheet.
  const onloadcssdefined = (cb) => {
    const resolvedHref = ss.href;
    const sheets = document.styleSheets;
    let i = sheets.length;
    i -= 1;
    while (i) {
      if (sheets[i].href === resolvedHref) {
        return cb();
      }
      i -= 1;
    }
    setTimeout(() => onloadcssdefined(cb));
    return null;
  };

  const loadCB = () => {
    if (ss.addEventListener) {
      ss.removeEventListener('load', loadCB);
    }
    ss.media = 'all';
    resolve(ss);
  };

  // once loaded, set link's media back to `all` so that the stylesheet applies once it loads
  if (ss.addEventListener) {
    ss.addEventListener('load', loadCB);
  }
  ss.onloadcssdefined = onloadcssdefined;
  onloadcssdefined(loadCB);
});

/**
   *
   *  Funcion que permite aadir librerias externas para cargar dinamicamente nuevos
   *  comandos y observadores
   *  la funcion recibe como parametro la ruta del fichero a cargar siguiendo el siguiente
   *  patron ${type}/${mapLib}@${version}/${action.key} y la funcion tiene que hacer el import
   *  dinamico import()
   * @example
   *
   * RxMap.addImportLib('test',arg => import(`../lib/${arg}`));
   *
   * @param {string} lib Nombre de la libreria
   * @param {function} func Funcion a invocar
   */
export const addImportFunction = (lib, func) => {
  _importFunctions[lib] = func;
};

export const loadLib = async (lib, mapLib, type, key, version = 'latest') => {
  const importFunc = _importFunctions[lib];
  if (importFunc) {
    const module = await importFunc(type, mapLib, version, key);
    return module.default || module[key];
  }
  throw new Error(`not Found Import function for ${lib}`);
};

/**
 * @private
 */
const _middlewares = {
  _global: [],
};

/**
 * @private
 */
const _subscribers = [];

/**
 * @private
 */
const compose = (action, ...funcs) => {
  if (funcs.length === 0) {
    return action;
  }
  if (funcs.length === 1) {
    return funcs[0](action);
  }
  return funcs.reduce((a, b) => a(b(action)));
};

/**
 *
 * @param {*} action
 * @private
 */
const executeAction = action => (commandBus, args) => action(commandBus.getContext(), ...args);

/**
 *
 * @param {*} actionName
 * @param {*} action
 * @private
 */
export const applyMiddlewares = (actionName, action) => {
  let middlewares = _middlewares._global;
  if (_middlewares[actionName]) {
    middlewares = _middlewares._global.concat(_middlewares[actionName]);
  }
  return compose(executeAction(action), ...middlewares);
};

/**
*
* funcion que permite registar los middlewares, para realizar acciones antes y depus de
* ejecutar una accin, se puden pasar mas de un middlleware .
* El primer parametro es opcional y es el nombre de la accin sobre la que se va a aplicar
* el middleware, si no se pasa ningun nombre se aplicar sobre todas las acciones.
*
* @example
* registerMiddleware('test',middleware1,middleware2);
* @example
* registerMiddleware(middleware1,middleware2);
*
* Las funciones del midleware son funciones que revien la accion a ejecutar y devuelve una
* funcin async que recibe como parametro el CommandBus y un array con los argumentos
* La funcin tiene que hacer lo que quiera, ejecutar la accin, volver a ejecutar el cdigo
* que desee y devolver el resultado de la accin ejecutada.
*
* @example
* const LoggerMiddleware = next => async (Map, args) => {
*  const actionName = Map.getActionName();
*  const now = new Date().getTime();
*  const name = `Command ${actionName} [${now}]: `;
*  console.log(`Pre ${name}`, args);
*  const res = await next(Map, args);
*  console.log(`Post ${name}`, res);
*  return res;
* };
* registerMiddleware(LoggerMiddleware);
*
*/
export const registerMiddleware = (actionName, ...middlewares) => {
  if (!actionName) {
    return;
  }
  if (typeof actionName === 'string') {
    _middlewares[actionName] = middlewares;
    _subscribers.forEach(func => func(actionName));
    return;
  }
  _middlewares._global = [actionName, ...middlewares];
  _subscribers.forEach(func => func());
};

export const subscribe = func => _subscribers.push(func);

