# Como funciona
## Cargar
Para empezar a utilizar la librera lo primero es cargar el mapa que se quiere utilizar para ello se puede hacer de dos maneras. Directamente con el mtodo load o con loadConfig los dos son mtodos asncronos que puedes usar con await o con formato promesa.


```
import { RxMap } from '@rxmap/rxmap';
const config = {};
await RxMap.load(leaflet,config);
```

```
import { RxMap } from '@rxmap/rxmap';
const config = {};
RxMap.load(leaflet,config).then((map)=>{
   // execute actions
});

```

O 

```
import { RxMapFromConfig } from '@rxmap/rxmap';

const config = {
  type: 'leaflet',
  options: {
    key: '',
  },
  map: {
    autoCenter: false,
    center: {
      lat: 51.505,
      lng: -0.09,
    },
    zoom: 13,
  },
};


const map = await RxMapFromConfig(config);


```

## Libreras
Para utilizar las acciones y los observadores tienes que cargar las libreras que quieras de acciones y observadores,  propias o de terceros. Al cargar las libreras ya tienes disponibles todas las acciones que incorporen estas libreras en RxMap o en los observadores, (una vez los recuperas desde RxMap < `rxMap.observer(from(5))`>). Pero al tener carga dinmica no bajas el cdigo de todas las acciones, reduciendo el tiempo de carga, sino que se cargara el cdigo de cada accin o observador cuando la utilices. ( lazy Loader) 

La funcin registerLib, espera como parmetros el nombre de la librera, un objeto con los nombre de acciones y con los nombre de los observadores a cargar de esa libreria, y la funcin para la carga dynamica de las acciones y observadores

```
import { registerLib } from '@rxmap/rxmap';

registerLib(test,{
	observers:[test],
	actions:[example]
},
(type, mapLib, version, key) => import(/* webpackMode: "lazy" */ `./${type}/${mapLib}@${version}/${key}`);
);

```

Idealmente las libreras incluyen en default un array con los parmetros ya preparados.

```
import { registerLib } from '@rxmap/rxmap';
import rxLib from '@rxmap/rxmap/lib';

registerLib(...rxLib);
```

Otra forma de tener acciones o observadores es registrndolos para poder utilizarlos,pero de esta forma no tendrs la carga dynamica I tendrs que gestionar ,qual cargas segn la librera de mapas que estes utilizando. Al contrario las libreras gestionan esto de manera automtica. 
Consulta la librera que utilizas para saber que mapas soporta. 

## Acciones
Las acciones son funciones puras que realizan acciones sobre el mapa, la idea es que solo realicen una nica accin para que sean mucho ms fciles de reaprovechar , probar y debugar.
Las acciones se pueden invocar sobre RxMap o sobre un observador. Las acciones se pueden anidar entre ellas. Cada invocacin de acciones es  asncrona pero dentro de cada secuencia en sncrona. Cada accin recibe el valor de la accin anterior para poder concatenar acciones.

```
RxMap.test();

RxMap.test2().test();

RxMap.observer(from(1)).test();

```

## Observadores
Los observadores son funciones que devuelven un observador ( RxJs )  para por ejemplo , gestionar los eventos del mapa como puede ser el click, o para gestionar datos que se pueden recibir continuamente como la posicin GPS, el centro del mapa, etc...
Con los observadores se pueden utilizar todos los operadores de RxJs para modificar, transformar , etc.. los valores del observador.

Tambin se pueden utilizar observadores creados con RxJs para utilizar las acciones de RxMap. 
Cuando  se utiliza un observador, se puede pasar como parmetro a la accin una funcin que transforme los argumentos en un array con los argumentos que espera la accin.


```
RxMap.observer(<observer name>).subscribe((data) => console.log);

RxMap.observer(gps).pipe(take(2)).subscribe(data=>console.log(data));

RxMap.observer(from([{lat:1,lng:2},{lat:2,lng:3}]).marker(data=>([data.lat,data.lng])).subscribe()


```

## Middlewares
RxMap tambin te permite usar middlewares, para realizar acciones como:
	* Logger de las funciones
	* Realizar acciones antes o despus de la ejecucin de las acciones.
	* Aplicar transformaciones
	* Etc...

Un middleware lo puedes aplicar sobre todas las acciones o sobre una accin en concreto.
Si al registrar el middleware el primer parmetro es un string, slo se aplicar a la accin con ese nombre. Si el primer parmetro es el middleware se aplicar a todas las acciones.

Se pueden aplicar todos los middleware que se deseen.

```

registerMiddleware(LoggerMiddleware);

O

registerMiddleware('marker', TimerMiddleware);

```

## Observar acciones
Con RxMap  puedes observar las acciones para poder saber cuando se llama una accin concreta  o un grupo de acciones con una expresin RegEx y realizar otra operacin.

```

RxMap.observerAction('marker').subscribe((data) => {
    console.log("Action Subscriber 1 got data >>>>> ", data);
  });


RxMap.observerAction('.').subscribe((data) => {
    console.log("Action Subscriber 2 got data >>>>> ", data);
  });

```

## Store Observable
RxMap dispone de un store que  te permite guardar informacin y observarla para realizar acciones cuando esta informacin se modifique.

```
RxMap.observerStore(test).subscribe((data) => {
    console.log("Store Subscriber 1 got data >>>>> ", data);
  });

RxMap.observerStore(.).subscribe((data) => {
    console.log("Store Subscriber 2 got data >>>>> ", data);
  });

RxMap.store.test = example;

RxMap.store.example = 5;

const t = RxMap.store.test;


```


Con estas opciones te permite generar un cdigo mucho ms desacoplado de la librera de mapas que quieras utilizar y de esas forma tu cdigo tendr una vida mucho ms larga, pudiendo actualizar cada versin de la librera o cambiando de ella con un esfuerzo mucho menor.

# Creacin

## Como crear acciones
Una accin es una funcin que recibe unos parmetros y devuelve el resultado o una promesa, puede ser una funcin async. Los objetivos de las acciones son interaccionar con el mapa. 
Es recomendable que slo utilicen un mtodo o propiedad  sobre el mapa para que sea ms fcil el desacoplarse.
Se pueden crear acciones que llamen a otras acciones.

Las acciones deben tener el mnimo posible de dependencias.
Es recomendable que cada accin se ubicaque en un fichero.
Las acciones se tienen que exportar como default  y se tiene que exportar la propiedad name con el nombre de la accin. Este nombre ser el nombre con en el que se registre y se utilizar para invocarla desde RxMap o desde los observadores.

A todas las acciones se les inyecta como primer parmetro el contexto que es un objeto que incluye:
	*  RxMap
	* La librera Nativa del Mapa
	* El valor de la anterior accin
	* El store

Un ejemplo de accin sera.
```
 const setCenter = (context, paramA, paramB) => {
       const map = context.source.getMap();
	     const oldCenter = map.getCenter();
		 map.setCenter(paramA,paramB);
		 return map;
};

export default setCenter;

```

Para poder utilizar esta accin hay dos formas. La puedes registrar manualmente o tenerla en una libreria y registrar la libreria.

Para registrar manualmente una accin se tendra que hacer lo siguiente.

```
import { registerAction, RxMap } from @rxmap/rxmap;
import { name }, action from ./actionExample;

registerAction(name,action);

RxMap.load(leaflet);
RxMap.create(mapId,0,0,8);
// aqu ya podramos utilizar la accin 
RxMap.setCenter(2.35,42.112);

```

Si registramos las acciones no estaremos utilizando la capacidad de cargar el cdigo de manera dynamica. Sino que se incluirn en el bundle principal de la aplicacin.

## Como crear observadores
Un observador es una funcin que puede o no recibir parmetros y que devuelve siempre un observador [RxJS]( 	https://rxjs-dev.firebaseapp.com)

La idea de los observadores es reemplazar los eventos para poder tener ms control sobre las cosas que pasan sobre el mapa. Y poder encadenar de manera mucho ms simple acciones a partir de cosas que pasen.
Con los observadores se pueden utilizar todos los transformadores y operadores de RxJS.

Los observadores deben tener el mnimo posible de dependencias.
Es recomendable que cada observador se ubicaque en un fichero.
Los observadores se tienen que exportar como default  y se tiene que exportar la propiedad name con el nombre del observador. Este nombre ser el nombre con en el que se registre y ser el nombre con el que se recuperar el observador.

A todos los observadores se les inyecta como primer parmetro el contexto que es un objeto que incluye:
	*  RxMap
	* La librera Nativa del Mapa
	* El valor de la anterior accin
	* El store

Un ejemplo de observador podra ser:

```
import { fromEventPattern } from 'rxjs/internal/observable/fromEventPattern';
import { map } from 'rxjs/internal/operators/map';

const event = (context) => {
  const googleMaps = context.library.maps;
  const map_ = context.source.getMap();

  const addClickHandler = handler => map_.addListener('center_changed', handler);
  const removeClickHandler = (handler, listener) => googleMaps.event.removeListener(listener);


  return fromEventPattern(
    addClickHandler,
    removeClickHandler,
  ).pipe(map(() => {
    const center = map_.getCenter();
    return { lat: center.lat(), lng: center.lng() };
  }));
};

export default event;
/**
 * @private
*/
export const name = 'center';

```

Para poder utilizar este observador  hay dos formas. La puedes registrar manualmente o tenerlo en una libreria y registrar la libreria.

Para registrar manualmente el observador se tendra que hacer lo siguiente.

```
import { registerObserver, RxMap } from @rxmap/rxmap;
import { name }, observer from ./observerExample;

registerObserver(name,observer);

RxMap.load(leaflet);
RxMap.create(mapId,0,0,8);
// aqu ya podramos utilizar la accin 
RxMap.observer(center).subscribe((data)=>{
   console.log(data);
});

```

Si registramos los observadores manualmente  no estaremos utilizando la capacidad de cargar el cdigo de manera dynamica. Sino que se incluirn en el bundle principal de la aplicacin.

## Como crear un middleware
Los middleware son funciones que devuelve una funcin, El middleware recibe como parmetro la siguiente accin a ejecutar y la funcin que devuelve debe ser asncrona y recibe como parmetros el CommandBus que esta realizando la ejecucin y los argumentos de la funcin en un array. La funcin debe devolver el resultado de la ejecucin de la accin.

Desde el CommandBus se puede recuperar el contexto con getContext() y el nombre de la funcin que esta ejecutando con getActionName().

En el middleware puedes hacer aciones antes de llamar a la accin a ejecutar. Y puedes modificar o hacer acciones despus de ejecutar la accin.

Un ejemplo de middleware podra ser el logger de las acciones:

```

export const LoggerMiddleware = next => async (CommandBus, args) => {
  const actionName = commandBus.getActionName();
  const now = new Date().getTime();
  const name = `Command ${actionName} [${now}]: `;
  console.log(`Pre ${name}`, args);
  const res = await next(Map, args);
  console.log(`Post ${name}`, res);
  return res;
};
```

Los middleware se tienen no se cargan dinmicamente se tienen que importar especficamente.

## Como crear una libreria

Las libreras se pueden crear dentro de tu proyecto o como un proyecto independiente para poder reaprovecharlas en otros proyectos.

Las libreras son un conjunto de acciones y observadores que ofrecen la misma funcionalidad sobre uno o diferentes mapas.

Idealmente tienen la siguiente estructura

<libName>_<type>_<mapType>:<version>/<actionName>

Example: lib_actions_google@latest_setCenter.js o lib_observer_google@latest_center.js

En las libreras cada accin o observador debe estar en un nico fichero y cada fichero debe exponer en default la accin y debe exponer la propiedad name con el nombre de la accin

Las libreras tienen que tener un fichero index.js que incluya  lo siguiente:

	* la funcin de carga dynamica de sus acciones y observadores. Esta funcin recibir como parmetros el tipo [observer|action] , el nombre de la libreria de mapas, la versin ( latest por defecto) y la clave o nombre de la accin o el observador. Se recomienda que se llame  func.

```
const func = (type, mapLib, version, key) => import(/* webpackMode: "lazy" */ `./${type}/${mapLib}@${version}/${key}`);

```

	* Array con el nombre de los observadores. Se recomienda que se llame  observers
	* Array con el nombre de las acciones. Se recomienda que se llame  actions
	* El nombre de la librera. Se recomienda que se llame  name.


Y es recomendable devolver en el parmetro por defecto un array con los datos en el orden que pide la funcin de registrar libreria.

Adjunto un ejemplo del fichero index.js

```

export const name = 'rxmap';
export const actions = ['addData', 'create', 'marker', 'point', 'popup', 'setCenter'];
export const observers = ['gps', 'center', 'click'];
export const func = (type, mapLib, version, key) => import(/* webpackMode: "lazy" */ `./${type}/${mapLib}@${version}/${key}`);

export default [
  name,
  {
    observers,
    actions,
  },
  func,
];

```


Cuando se compila las libreras tienen que inlcuir la version con Mdulos ( Es2015 ) y la version UMD, en la versin UMD que suele ser la que se pblica en servicios como unpkg la ruta de la carga de libreras dinmicas deber ser con la url completa no relativa.

